import { Box } from "@mui/material";
import { themes } from "../../../config/icons";

const body = () =>{

    const themeMode = themes.light

    return (
        <Box
            display="flex"
            alignItems="center"
            justifyContent="center"
            padding="0px 8px"
        >
            <Box flex={1}>
                <Box component={"img"}
                    src={themeMode.imagen.imgnovia}
                />
            </Box>
            <Box flex={1}>
                
            </Box>
        </Box>
    );
}

export default body;
